import { Button } from "antd";
import React from "react";
import { BsBookFill, BsCollectionPlayFill } from "react-icons/bs";

export default function Story() {
  return (
    <div style={{ backgroundColor: "white" }}>
      <div style={{ display: "flex", width: "100%",padding: 10 }}>
        <span
          style={{
            display: "flex",
            width: "100%",
            justifyContent: "center",
            borderBottom: "1px solid blue",
          }}
        >
          <Button
            style={{
              display: "flex",
              alignItems: "center",
              justifyContent: "center",
              width: "100%",
              fontSize: 20,
              color: "#606266",
            }}
            type="text"
          >
            <BsBookFill style={{ marginRight: 10 }} />
            Tin
          </Button>
        </span>
        <span
          style={{ display: "flex", width: "100%", justifyContent: "center" }}
        >
          <Button
            style={{
              display: "flex",
              alignItems: "center",
              justifyContent: "center",
              width: "100%",
              fontSize: 20,
              color: "#606266",
            }}
            size="large"
            type="text"
          >
            <BsCollectionPlayFill style={{ marginRight: 10 }} />
            Reels
          </Button>
        </span>
      </div>
    </div>
  );
}
